edia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB-%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%B8%D0%BD%D1%8B\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b-\u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0441\u0442\u0432\u043e \u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u044b\">\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1605_%D0%B3%D0%BE%D0%B4\" title=\"1605 \u0433\u043e\u0434\">1605<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 \u043f\u0430\u043f\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B8%D0%BC%D0%B5%D0%BD%D1%82_VIII_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041a\u043b\u0438\u043c\u0435\u043d\u0442 VIII (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430 VIII<\/a> \u0438 \u0435\u0433\u043e \u043f\u0440\u0435\u0435\u043c\u043d\u0438\u043a\u0430 \u043f\u0430\u043f\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B2_XI\" title=\"\u041b\u0435\u0432 XI\">\u041b\u044c\u0432\u0430 XI<\/a> \u043d\u043e\u0432\u044b\u043c \u043f\u0430\u043f\u043e\u0439 \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_V_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041f\u0430\u0432\u0435\u043b V (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041f\u0430\u0432\u0435\u043b V<\/a> \u0438\u0437\u0431\u0440\u0430\u043d \u041a\u0430\u043c\u0438\u043b\u043b\u043e \u0411\u043e\u0440\u0433\u0435\u0437\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1619_%D0%B3%D0%BE%D0%B4\" title=\"1619 \u0433\u043e\u0434\">1619<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wik