43e\u043c \u0446\u0430\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u044b \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0418\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D0%B7%D0%BD%D1%8C\" title=\"\u0421\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c\">\u0441\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1764_%D0%B3%D0%BE%D0%B4\" title=\"1764 \u0433\u043e\u0434\">1764<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BA%D0%B0%D1%81%D0%B0%D1%80_%D0%B2_%D0%A1%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%B8\" title=\"\u0410\u043b\u044c\u043a\u0430\u0441\u0430\u0440 \u0432 \u0421\u0435\u0433\u043e\u0432\u0438\u0438\">\u0410\u043b\u044c\u043a\u0430\u0441\u0430\u0440\u0435 \u0421\u0435\u0433\u043e\u0432\u0438\u0438<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u041a\u043e\u043b\u043b\u0435\u0434\u0436 \u0410\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0438, \u043d\u044b\u043d\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u043a\u0430\u043a <a href=\"https:\/\/es.wikipedia.org\/wiki\/Academia_de_Artiller%C3%ADa\" class=\"extiw\" title=\"es:Academia de Artiller\u00eda\">\u0410\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0439\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%90%D1%80%D1%82%D0%B8%D0%BB%D0%BB%D0%B5%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%8F&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0410\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0439\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0440\u0443\u0441\u0441\u043a.<\/a>&#160;\u2014 \u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0449\u0430\u044f \u0432\u043e\u0435\u043d\u043d\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1768_%D0%B3%D0%BE%D0%B4\" title=\"1768 \u0433\u043e\u0434\">1768<\/a>&#160;\u2014 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II<\/a> \u0438\u0437\u0434\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D0%B0%D0%B7\" title=\"\u0423\u043a\u0430\u0437\">\u0443\u043a\u0430\u0437<\/a> \u043e \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0443 I<\/a>&#160;\u2014 \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B2%D1%81%D0%B0%D0%B4%D0%BD%D0%B8%D0%BA\" title=\"\u041c\u0435\u0434\u043d\u044b\u0439 \u0432\u0441\u0430\u0434\u043d\u0438\u043a\">\u041c\u0435\u0434\u043d\u043e\u0433\u043e \u0432\u0441\u0430\u0434\u043d\u0438\u043a\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1769_%D0%B3%D0%BE%D0%B4\" title=\"1769 \u0433\u043e\u0434\">1769<\/a>&#160;\u2014 \u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%80%D0%B3%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0438\u0440\u0433\u0438\u043d\u0438\u044f\">\u0412\u0438\u0440\u0433\u0438\u043d\u0438\u0438<\/a> \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b, \u0447\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a> \u043d\u0435 \u0438\u043c\u0435\u0435\u0442 \u043f\u0440\u0430\u0432\u0430 \u0441\u043e\u0431\u0438\u0440\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BB%D0%BE%D0%B3\" title=\"\u041d\u0430\u043b\u043e\u0433\">\u043d\u0430\u043b\u043e\u0433\u0438<\/a> \u0441 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u0441\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1770_%D0%B3%D0%BE%D0%B4\" title=\"1770 \u0433\u043e\u0434\">1770<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%84%D0%B8%D0%BD\" title=\"\u0414\u043e\u0444\u0438\u043d\">\u0414\u043e\u0444\u0438\u043d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> (\u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XVI\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI<\/a>) \u0432\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 \u0431\u0440\u0430\u043a \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F-%D0%90%D0%BD%D1%82%D1%83%D0%B0%D0%BD%D0%B5%D1%82%D1%82%D0%B0\" title=\"\u041c\u0430\u0440\u0438\u044f-\u0410\u043d\u0442\u0443\u0430\u043d\u0435\u0442\u0442\u0430\">\u041c\u0430\u0440\u0438\u0435\u0439 \u0410\u043d\u0442\u0443\u0430\u043d\u0435\u0442\u0442\u043e\u0439<\/a>, \u0434\u043e\u0447\u0435\u0440\u044c\u044e \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%A2%D0%B5%D1%80%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u041c\u0430\u0440\u0438\u044f \u0422\u0435\u0440\u0435\u0437\u0438\u044f\">\u041c\u0430\u0440\u0438\u0438 \u0422\u0435\u0440\u0435\u0437\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1811_%D0%B3%D0%BE%D0%B4\" title=\"1811 \u0433\u043e\u0434\">1811<\/a>&#160;\u2014 \u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0443 \u0434\u0435\u0440\u0435\u0432\u043d\u0438 \u0410\u043b\u044c\u0431\u0443\u044d\u0440\u0430 \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4\" title=\"\u0413\u043e\u0440\u043e\u0434\">\u0433\u043e\u0440\u043e\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B4%D0%B0%D1%85%D0%BE%D1%81\" title=\"\u0411\u0430\u0434\u0430\u0445\u043e\u0441\">\u0411\u0430\u0434\u0430\u0445\u043e\u0441<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044f<\/a>), \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430, \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0445 \u0438 \u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a (43 \u0442\u044b\u0441.) \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u044e\u0442 \u0432\u043e\u0439\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a> (23 \u0442\u044b\u0441.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u0420\u0435\u0448\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81\" title=\"\u0412\u0435\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\">\u0412\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430<\/a> \u0431\u043e\u0301\u043b\u044c\u0448\u0430\u044f \u0447\u0430\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u043e\u0435 \u0433\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u043e\">\u0413\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u0430 \u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u043e\u0433\u043e<\/a> \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0430 \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u00ab\u043d\u0430 \u0432\u0435\u0447\u043d\u044b\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0430\u00bb \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5\" title=\"\u0426\u0430\u0440\u0441\u0442\u0432\u043e \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0435\">\u0426\u0430\u0440\u0441\u0442\u0432\u0430 \u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1816_%D0%B3%D0%BE%D0%B4\" title=\"1816 \u0433\u043e\u0434\">1816<\/a>&#160;\u2014 \u00ab\u0434\u0435\u043d\u044c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%BE%D0%B5%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B8%D1%81%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u0418\u043d\u0434\u043e\u0435\u0432\u0440\u043e\u043f\u0435\u0438\u0441\u0442\u0438\u043a\u0430\">\u0438\u043d\u0434\u043e\u0435\u0432\u0440\u043e\u043f\u0435\u0438\u0441\u0442\u0438\u043a\u0438<\/a>\u00bb. \u042d\u0442\u0438\u043c \u0434\u043d\u0451\u043c \u0434\u0430\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043e \u043f\u0440\u0435\u0434\u0438\u0441\u043b\u043e\u0432\u0438\u0435 \u0440\u0430\u0431\u043e\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BF%D0%BF,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86\" title=\"\u0411\u043e\u043f\u043f, \u0424\u0440\u0430\u043d\u0446\">\u0424\u0440\u0430\u043d\u0446\u0430 \u0411\u043e\u043f\u043f\u0430<\/a> \u00ab\u00dcber das Conjugationssystem der Sanskritsprache in Vergleichung mit jenem der griechischen, lateinischen, persischen und germanischen Sprache\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1836_%D0%B3%D0%BE%D0%B4\" title=\"1836 \u0433\u043e\u0434\">1836<\/a>&#160;\u2014 27-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE,_%D0%AD%D0%B4%D0%B3%D0%B0%D1%80_%D0%90%D0%BB%D0%BB%D0%B0%D0%BD\" title=\"\u041f\u043e, \u042d\u0434\u0433\u0430\u0440 \u0410\u043b\u043b\u0430\u043d\">\u042d\u0434\u0433\u0430\u0440 \u0410\u043b\u043b\u0430\u043d \u041f\u043e<\/a> \u0436\u0435\u043d\u0438\u0442\u0441\u044f \u043d\u0430 \u0441\u0432\u043e\u0435\u0439 13-\u043b\u0435\u0442\u043d\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B4%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u043e\u0434\u0441\u0442\u0432\u043e\">\u043a\u0443\u0437\u0438\u043d\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE,_%D0%92%D0%B8%D1%80%D0%B4%D0%B6%D0%B8%D0%BD%D0%B8%D1%8F_%D0%AD%D0%BB%D0%B8%D0%B7%D0%B0_%D0%9A%D0%BB%D0%B5%D0%BC%D0%BC\" title=\"\u041f\u043e, \u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u044f \u042d\u043b\u0438\u0437\u0430 \u041a\u043b\u0435\u043c\u043c\">\u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u0438 \u041a\u043b\u0435\u043c\u043c<\/a>, \u0431\u043e\u043b\u044c\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%B1%D0%B5%D1%80%D0%BA%D1%83%D0%BB%D1%91%D0%B7\" title=\"\u0422\u0443\u0431\u0435\u0440\u043a\u0443\u043b\u0451\u0437\">\u0442\u0443\u0431\u0435\u0440\u043a\u0443\u043b\u0451\u0437\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA%D1%81,_%D0%9A%D0%B0%D1%80%D0%BB\" title=\"\u041c\u0430\u0440\u043a\u0441, \u041a\u0430\u0440\u043b\">\u041a\u0430\u0440\u043b \u041c\u0430\u0440\u043a\u0441<\/a> \u0432\u044b\u0441\u043b\u0430\u043d \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863_%D0%B3%D0%BE%D0%B4\" title=\"1863 \u0433\u043e\u0434\">1863<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u041e\u0434\u0435\u0441\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u041e\u0434\u0435\u0441\u0441\u043a\u043e\u0439 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 <a h