42\u044c \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u044b \u0434\u043b\u044f \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u0441\u0432\u043e\u0438\u0445 \u043f\u0435\u0440\u0432\u044b\u0445 \u0430\u0442\u043e\u043c\u043d\u044b\u0445 \u0431\u043e\u043c\u0431, \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0441\u0431\u0440\u043e\u0448\u0435\u043d\u043d\u044b\u0445 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044e<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 \u043f\u0435\u0440\u0435\u0442\u0430\u0440\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0432\u043e \u0432\u0441\u0435\u0445 \u043e\u0442\u0440\u0430\u0441\u043b\u044f\u0445 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e\u0441\u0442\u0438: \u043d\u043e\u0440\u043c\u044b \u0432\u044b\u0440\u0430\u0431\u043e\u0442\u043a\u0438 \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u044b, \u0440\u0430\u0441\u0446\u0435\u043d\u043a\u0438 \u043f\u043e\u043d\u0438\u0436\u0435\u043d\u044b.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931_%D0%B3%D0%BE%D0%B4\" title=\"1931 \u0433\u043e\u0434\">1931<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0430\u043f\u04