><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a><ul><li>\u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u0447\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u0432\u0437\u0430\u0438\u043c\u043e\u043f\u043e\u043c\u043e\u0449\u0438.<\/li><li>\u0411\u044e\u0440\u043e \u0421\u043e\u0447\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0440\u043a\u043e\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0412\u041a\u041f(\u0431)<\/a> \u043f\u043e\u0441\u0435\u0442\u0438\u043b\u043e \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0443 \u0431\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432\u0441\u043a\u0438\u0439, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\">\u041d. \u041e\u0441\u0442\u0440\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a> \u0438 \u0437\u0430\u0441\u043b\u0443\u0448\u0430\u043b\u043e \u043e\u0442\u0447\u0451\u0442 \u043e \u0435\u0433\u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u043a\u043e\u0439 \u0434\u0435\u044f\u0442\u0